import React from "react";
import Card from "../UI/Card";
import styles from "./UsersList.module.css";

const UserList = props => {

    const listRender = (props) => {
        console.log(props);
        let list = [];
        if(typeof props.users != "undefined" && props.users.length > 0)
        {
            list = props.users.map(user => <li key={user.name}>{user.name} ({user.age} years old)</li>);
        }
        
        return list;
    };
    
    return (
        <Card className={styles.users}>
         <ul>{props.users.map(user => <li key={user.name}>{user.name} ({user.age} years old)</li>)}</ul>
        </Card>
    );
};


export default UserList;
